import React from 'react';
import './about.css';
import {useEffect} from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import myImg from './images/about.jpg';
import myLogo from './images/logo.png';
// Imports from MUI lib


const AboutPage = () => {

    // The title will update at every refresh
    useEffect(() => {
        document.title = 'About Page';
    }, []);


    return (
        <div className='about-container'>
            <section>
                <div className="main">
                    <div className="images">
                        <div className="blue-bg-outer">
                            <div className="white-bg">
                                <div className="blue-bg">
                                    <img src={myImg} height='300px' width='120px' alt="image"/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="Information">
                        <h1>Hi, I'm Alex</h1>
                        <div className="animated_text">
                            <h1 className="title">Web Developer</h1>
                        </div>
                        <div className="social">
                            <a href="https://github.com/bikashdev01"><i className="bi bi-github"></i></a>
                            <a href="https://www.youtube.com/@Web_Devs__"><i className="bi bi-youtube"></i></a>
                            <a href="https://www.instagram.com/web_devs__/"><i className="bi bi-instagram"></i></a>
                            <a href="https://www.linkedin.com/in/vikash-web-dev/"><i className="bi bi-linkedin"></i></a>
                        </div>
                        <button className="cv-btn">Download CV</button>
                    </div>
                </div>
            </section>
        </div>
    );
}
export default AboutPage;
